import Link from 'next/link';

const Navbar = () => (
	<div>
	  	<ul>
	  		<li><Link href='/'><a>Home</a></Link></li>
	  		<li><Link href='/individual_hoopers'><a>Individual Hoopers</a></Link></li>
	  	</ul>
  </div>
)

export default Navbar;
